import userIcon from '../img/userIcon.png'
import './HeaderStyle.css'

function Nav() {
    return (
        <>
        <div className='navcontaner'>
            <div>
                <p>자유게시판</p>
                <p>중고마켓</p>
            </div>
            <img src={userIcon} alt='유저 아이콘'/>
        </div>
        </>
    );
}

export default Nav;
